import{_ as a,c as t,o as r,ag as o}from"./chunks/framework.BRQrZDXk.js";const b=JSON.parse('{"title":"","description":"","frontmatter":{},"headers":[],"relativePath":"3_Designers/Design-Pattern-Library.md","filePath":"3_Designers/Design-Pattern-Library.md"}'),s={name:"3_Designers/Design-Pattern-Library.md"};function n(i,e,h,l,c,p){return r(),t("div",null,e[0]||(e[0]=[o(`<p>The Design Pattern Library audits all the different types of components that exist in the Open Library codebase. We are currently in the process of migrating this to a Storybook instance (see #4179).</p><h2 id="inspiration" tabindex="-1">Inspiration <a class="header-anchor" href="#inspiration" aria-label="Permalink to &quot;Inspiration&quot;">​</a></h2><p>Inspired by <a href="https://design.wikimedia.org/style-guide/visual-style.html" target="_blank" rel="noreferrer">Wikimedia&#39;s style guide</a>.</p><h2 id="how-to-contribute" tabindex="-1">How to Contribute <a class="header-anchor" href="#how-to-contribute" aria-label="Permalink to &quot;How to Contribute&quot;">​</a></h2><ul><li>Help us get the storybook added in #4179 publishing to github pages.</li><li>Link the storybook from this page</li><li>If a component is documented here, add it to the storybook and remove it from this wiki page.</li><li>When this page is fully migrated to storybook, please make this page redirect to the new storybook instance</li></ul><h3 id="adding-a-component" tabindex="-1">Adding a Component <a class="header-anchor" href="#adding-a-component" aria-label="Permalink to &quot;Adding a Component&quot;">​</a></h3><p>The documentation for a UI component includes:</p><ul><li>a <code>name</code> — in this case it’s called <code>Decorated-Carousel</code> (required)</li><li>a <code>location</code> (required) which is an example URL or page where the component may be found on the website</li><li>a <code>short description</code> (optional) of what the component is</li><li>a <code>screenshot</code> of the UI component (required)</li></ul><h3 id="example" tabindex="-1">Example <a class="header-anchor" href="#example" aria-label="Permalink to &quot;Example&quot;">​</a></h3><p>This is an example of a UI component on openlibrary.org (one of our other projects). <img src="https://user-images.githubusercontent.com/978325/54941943-4e553980-4eeb-11e9-8d04-6d1c5ad9a64f.png" alt="Screen Shot 2019-03-25 at 10 27 28AMPDT"></p><h2 id="frequently-asked-questions" tabindex="-1">Frequently Asked Questions <a class="header-anchor" href="#frequently-asked-questions" aria-label="Permalink to &quot;Frequently Asked Questions&quot;">​</a></h2><h3 id="how-do-i-choose-a-name" tabindex="-1"><em>How do I choose a name?</em> <a class="header-anchor" href="#how-do-i-choose-a-name" aria-label="Permalink to &quot;_How do I choose a name?_&quot;">​</a></h3><p>If you look through the website’s css/html, you may see a class name which describes the component. This is probably the right name to include in the docs for the component, even if it’s not the best name — if you have a suggestion for a better name, <em>please include both</em>! It’s important to include the CSS name(s) (even if it’s not the best name) because this is what will help us find the component in our code.</p><h3 id="how-do-i-know-what-s-a-component" tabindex="-1"><em>How do I know what’s a component?</em> <a class="header-anchor" href="#how-do-i-know-what-s-a-component" aria-label="Permalink to &quot;_How do I know what’s a component?_&quot;">​</a></h3><p>Generally, a component will be a visual element which occurs repeatedly on the website (like a special button, a dropdown menu, a box containing download options, etc)</p><h3 id="how-do-i-add-a-screenshot" tabindex="-1"><em>How do I add a screenshot!?</em> <a class="header-anchor" href="#how-do-i-add-a-screenshot" aria-label="Permalink to &quot;_How do I add a screenshot!?_&quot;">​</a></h3><p>This is actually kind of a hack, sorry! You can&#39;t drag screenshots directly into this document. Here&#39;s what I do:</p><ol><li>Open a new window to <a href="http://github.com/internetarchive/iaux/issues/new" target="_blank" rel="noreferrer">http://github.com/internetarchive/iaux/issues/new</a></li><li>The Issues UI <strong>does</strong> allow you to drag a image into the comment section of the issue!</li><li>When you drag and drop your screenshot into the issue, it should appear as something like <code>![Screen Shot 2019-03-25 at 10 50 00AMPDT](https://user-images.githubusercontent.com/978325/54942862-3aaad280-4eed-11e9-8f53-04e734db45ce.png)</code></li><li>Copy this snippet and paste it into this Design Pattern Library in the appropriate section for the component you are documenting.</li></ol><h2 id="components" tabindex="-1">Components <a class="header-anchor" href="#components" aria-label="Permalink to &quot;Components&quot;">​</a></h2><p>These are components on Open Library to be made modular and documented:</p><h3 id="admin-table" tabindex="-1">Admin table <a class="header-anchor" href="#admin-table" aria-label="Permalink to &quot;Admin table&quot;">​</a></h3><p><img src="https://user-images.githubusercontent.com/148752/52247175-ad101680-289d-11e9-9ddb-821680f6818c.png" alt="screen shot 2019-02-04 at 4 54 07 pm"><img src="https://user-images.githubusercontent.com/148752/52247176-ad101680-289d-11e9-9efe-919f128266fd.png" alt="screen shot 2019-02-04 at 4 55 01 pm"></p><p>Seen on</p><h3 id="book" tabindex="-1">Book <a class="header-anchor" href="#book" aria-label="Permalink to &quot;Book&quot;">​</a></h3><p><img src="https://user-images.githubusercontent.com/148752/45910063-1134b100-bdbb-11e8-9b1e-aaf2982c483f.png" alt="screen shot 2018-09-21 at 4 25 39 pm"></p><p>Is used in the <a href="#Carousel">Carousel component</a> to display books. Note, the button inside this component is bespoke (a book-cta) - see #1158.</p><h3 id="contenthead" tabindex="-1">ContentHead <a class="header-anchor" href="#contenthead" aria-label="Permalink to &quot;ContentHead&quot;">​</a></h3><p>Can appear once at the top of any page.</p><p><img src="https://user-images.githubusercontent.com/148752/46588080-f6b13780-ca4a-11e8-9217-e47b9c4252cc.png" alt="screen shot 2018-10-07 at 4 06 10 pm"></p><p>Consists of the page title, an inline &quot;count&quot; and a set of tools.</p><p>Other elements can be rendered under the tools but are not part of the component.</p><h3 id="ctabtn" tabindex="-1">CtaBtn <a class="header-anchor" href="#ctabtn" aria-label="Permalink to &quot;CtaBtn&quot;">​</a></h3><p>See <a href="http://internetarchive.github.io/openlibrary/?path=/story/legacy-button--cta-btn" target="_blank" rel="noreferrer">Storybook instance</a>.</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>&lt;div class=&quot;cta-btn&quot;&gt;CTABtn&lt;/div&gt;</span></span></code></pre></div><p><img src="https://user-images.githubusercontent.com/148752/51230361-8b61e600-1914-11e9-864c-319f056e0d78.png" alt="screen shot 2019-01-15 at 10 25 48 pm"></p><p><img src="https://user-images.githubusercontent.com/978325/71931917-bd86dc00-3153-11ea-9540-dabe0f33288f.png" alt="openlibrary org_search_q=cracking+code mode=everything"></p><h4 id="cta-btn-unavailable" tabindex="-1">cta-btn--unavailable <a class="header-anchor" href="#cta-btn-unavailable" aria-label="Permalink to &quot;cta-btn--unavailable&quot;">​</a></h4><p><img src="https://user-images.githubusercontent.com/148752/51229922-075b2e80-1913-11e9-9d89-f695cc1071e5.png" alt="screen shot 2019-01-15 at 10 14 54 pm"></p><h4 id="cta-btn-available" tabindex="-1">cta-btn--available <a class="header-anchor" href="#cta-btn-available" aria-label="Permalink to &quot;cta-btn--available&quot;">​</a></h4><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>&lt;div class=&quot;cta-btn cta-btn--available&quot;&gt;CTABtn&lt;/div&gt;</span></span></code></pre></div><p><img src="https://user-images.githubusercontent.com/148752/51229966-37a2cd00-1913-11e9-962f-ad67a187de50.png" alt="screen shot 2019-01-15 at 10 15 53 pm"><img src="https://user-images.githubusercontent.com/978325/71932013-ea3af380-3153-11ea-8077-43a5e1ce0494.png" alt="openlibrary org_books_OL1395236M_Influence (1)"></p><h4 id="cta-btn-shell-cta-btn-preview" tabindex="-1">cta-btn--shell cta-btn--preview <a class="header-anchor" href="#cta-btn-shell-cta-btn-preview" aria-label="Permalink to &quot;cta-btn--shell cta-btn--preview&quot;">​</a></h4><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>&lt;div class=&quot;cta-btn cta-btn--shell cta-btn--preview&quot;&gt;Preview&lt;/div&gt;</span></span></code></pre></div><p><img src="https://user-images.githubusercontent.com/978325/71932174-338b4300-3154-11ea-8c78-c7f1561316c4.png" alt="openlibrary org_books_OL18628948M_Cracking_the_communication_code"></p><h4 id="with-badge" tabindex="-1">with badge <a class="header-anchor" href="#with-badge" aria-label="Permalink to &quot;with badge&quot;">​</a></h4><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>&lt;div class=&quot;cta-btn&quot;&gt;</span></span>
<span class="line"><span>  Join waiting list</span></span>
<span class="line"><span>  &lt;div class=&quot;cta-btn__badge&quot;&gt;4&lt;/div&gt;</span></span>
<span class="line"><span>&lt;/div&gt;</span></span></code></pre></div><p><img src="https://user-images.githubusercontent.com/148752/51262084-7ada5b80-1966-11e9-8345-b9c93ce4a92a.png" alt="screen shot 2019-01-16 at 8 11 39 am"></p><p><a href="https://openlibrary.org/search?q=Amy+Tan" target="_blank" rel="noreferrer">Example</a><a href="https://openlibrary.org/works/OL1843755W/The_bonesetter&#39;s_daughter" target="_blank" rel="noreferrer">Example 2</a></p><h3 id="cover" tabindex="-1">Cover <a class="header-anchor" href="#cover" aria-label="Permalink to &quot;Cover&quot;">​</a></h3><p><img src="https://user-images.githubusercontent.com/148752/46235083-8826f800-c32d-11e8-90e8-3bba12ed484d.png" alt="screen shot 2018-09-28 at 2 48 08 pm"></p><p>Extremely similar to the <a href="#book">Book</a> component. Seen on <a href="https://openlibrary.org/subjects/science" target="_blank" rel="noreferrer">https://openlibrary.org/subjects/science</a></p><p>Makes use of <a href="#buttonCta">buttonCta</a></p><h3 id="buttonbtn" tabindex="-1">ButtonBtn <a class="header-anchor" href="#buttonbtn" aria-label="Permalink to &quot;ButtonBtn&quot;">​</a></h3><p><img src="https://user-images.githubusercontent.com/148752/45910857-9753f600-bdc1-11e8-9dd5-365237185e62.png" alt="screen shot 2018-09-21 at 5 12 42 pm"></p><p>As seen in component <a href="#pagebanner">PageBanner</a></p><h4 id="modifiers" tabindex="-1">modifiers <a class="header-anchor" href="#modifiers" aria-label="Permalink to &quot;modifiers&quot;">​</a></h4><p>If this button is not large enough for add the large modifier (&#39;btn--large&#39;)</p><p>e.g. the read ebook button on <a href="https://openlibrary.org/books/OL7885696M/Charlotte&#39;s_Web" target="_blank" rel="noreferrer">a book page</a></p><p><img src="https://user-images.githubusercontent.com/148752/47944809-46084d80-debb-11e8-8605-3701e29136f8.png" alt="screen shot 2018-11-02 at 4 20 35 pm"></p><h4 id="notes" tabindex="-1">notes <a class="header-anchor" href="#notes" aria-label="Permalink to &quot;notes&quot;">​</a></h4><p>See #1158</p><h3 id="buttongeneric" tabindex="-1">ButtonGeneric <a class="header-anchor" href="#buttongeneric" aria-label="Permalink to &quot;ButtonGeneric&quot;">​</a></h3><p><img src="https://user-images.githubusercontent.com/148752/45910888-c9655800-bdc1-11e8-997c-3bb87da9616b.png" alt="screen shot 2018-09-21 at 5 14 15 pm"></p><p>As seen in the sign up button! See #1158</p><h3 id="buttonghost" tabindex="-1">ButtonGhost <a class="header-anchor" href="#buttonghost" aria-label="Permalink to &quot;ButtonGhost&quot;">​</a></h3><p>Appears in the <a href="#iaBar">iaBar</a></p><p><img src="https://user-images.githubusercontent.com/148752/45986619-8bff0580-c021-11e8-8e77-5b3932a2e067.png" alt="screen shot 2018-09-24 at 5 44 40 pm"></p><h3 id="buttonbrowserdefault-was-buttonsearch" tabindex="-1">ButtonBrowserDefault (was ButtonSearch) - <a class="header-anchor" href="#buttonbrowserdefault-was-buttonsearch" aria-label="Permalink to &quot;ButtonBrowserDefault (was ButtonSearch) -&quot;">​</a></h3><p>It is used to submit the search query. Uses slightly modified default browser styles.</p><p>Seen - <a href="https://openlibrary.org/search?q=harry+potter" target="_blank" rel="noreferrer">https://openlibrary.org/search?q=harry+potter</a> , <a href="https://openlibrary.org/search" target="_blank" rel="noreferrer">https://openlibrary.org/search</a></p><p><img src="https://user-images.githubusercontent.com/31198893/46106369-1bf5a880-c1f6-11e8-8662-d3cf18fe6e1b.png" alt="search-button"></p><h3 id="buttoncta" tabindex="-1">ButtonCta <a class="header-anchor" href="#buttoncta" aria-label="Permalink to &quot;ButtonCta&quot;">​</a></h3><p>Styled with .cta-btn, this button is a little Dr Jekyll and Hyde in how it is defined, but it always looks similar, only varying by color.</p><h3 id="buttonlink" tabindex="-1">ButtonLink <a class="header-anchor" href="#buttonlink" aria-label="Permalink to &quot;ButtonLink&quot;">​</a></h3><p>Currently used in the <a href="#edit-toolbar">EditToolbar</a> component.</p><p><img src="https://user-images.githubusercontent.com/148752/46819895-ba772300-cd39-11e8-87bc-2eb9bff4b841.png" alt="screen shot 2018-10-11 at 9 40 32 am"></p><h3 id="borrowbookform" tabindex="-1">BorrowBookForm <a class="header-anchor" href="#borrowbookform" aria-label="Permalink to &quot;BorrowBookForm&quot;">​</a></h3><p>(please help document me!)</p><h3 id="borrowtable" tabindex="-1">BorrowTable <a class="header-anchor" href="#borrowtable" aria-label="Permalink to &quot;BorrowTable&quot;">​</a></h3><p>A table listing <img src="https://user-images.githubusercontent.com/148752/45578856-d4a40b00-b838-11e8-826f-9e54f2051257.png" alt="BorrowTable"></p><p>the table appears differently if loans are activated: <img width="936" alt="Screen Shot 2020-03-28 at 10 56 04 AM" src="https://user-images.githubusercontent.com/148752/77830018-cea41100-70e2-11ea-94c1-4f9da1a2d35f.png"></p><p>Used on the following pages:</p><ul><li><a href="https://openlibrary.org/account/loans" target="_blank" rel="noreferrer">https://openlibrary.org/account/loans</a></li></ul><h3 id="carousel" tabindex="-1">Carousel <a class="header-anchor" href="#carousel" aria-label="Permalink to &quot;Carousel&quot;">​</a></h3><p>Arrows are fonts rendered via the slick library. This carousel contains several <a href="#CategoryItem">CategoryItems</a></p><p><img src="https://user-images.githubusercontent.com/148752/45588422-678c8600-b8c9-11e8-9aaf-daeb1fa1774a.png" alt="Carousel"></p><h4 id="decorated-carousel" tabindex="-1">Decorated-Carousel <a class="header-anchor" href="#decorated-carousel" aria-label="Permalink to &quot;Decorated-Carousel&quot;">​</a></h4><p>A decorated carousel has background:</p><p><img src="https://user-images.githubusercontent.com/978325/45579855-f81e8400-b83f-11e8-967c-1dd8c07ef575.png" alt="Carousel-decorated"></p><p>This is used on [the works page]:</p><p>(<a href="https://openlibrary.org/works/OL69395W/Historie_of_the_raigne_of_King_Henry_the_Seventh" target="_blank" rel="noreferrer">https://openlibrary.org/works/OL69395W/Historie_of_the_raigne_of_King_Henry_the_Seventh</a>).</p><h4 id="carousel-section" tabindex="-1">Carousel-section <a class="header-anchor" href="#carousel-section" aria-label="Permalink to &quot;Carousel-section&quot;">​</a></h4><p>A carousel section wraps a carousel and a heading.</p><p><img src="https://user-images.githubusercontent.com/148752/45588442-9efb3280-b8c9-11e8-8b37-7dacb990cdce.png" alt="Carousel-section"></p><h3 id="categoryitem" tabindex="-1">CategoryItem <a class="header-anchor" href="#categoryitem" aria-label="Permalink to &quot;CategoryItem&quot;">​</a></h3><p><img src="https://user-images.githubusercontent.com/148752/45986547-0e3afa00-c021-11e8-8883-dfc5f9cd1e3d.png" alt="screen shot 2018-09-24 at 5 40 54 pm"></p><p>(appears on home page)</p><h3 id="chart" tabindex="-1">Chart <a class="header-anchor" href="#chart" aria-label="Permalink to &quot;Chart&quot;">​</a></h3><p>As on <a href="https://openlibrary.org/subjects/fantasy" target="_blank" rel="noreferrer">subject page</a></p><p><img src="https://user-images.githubusercontent.com/148752/46221555-7f6cfc80-c302-11e8-880a-7163c194acac.png" alt="screen shot 2018-09-28 at 9 38 25 am"></p><h3 id="chartstats" tabindex="-1">ChartStats <a class="header-anchor" href="#chartstats" aria-label="Permalink to &quot;ChartStats&quot;">​</a></h3><p>As seen on <a href="https://openlibrary.org/stats" target="_blank" rel="noreferrer">stats</a></p><p><img src="https://user-images.githubusercontent.com/148752/48813323-31192000-eceb-11e8-9c3f-9a5525a189bf.png" alt="screen shot 2018-11-20 at 5 38 47 pm"></p><h3 id="colorboxoverlay" tabindex="-1">ColorBoxOverlay <a class="header-anchor" href="#colorboxoverlay" aria-label="Permalink to &quot;ColorBoxOverlay&quot;">​</a></h3><p>An overlay that expands images. Visible when clicking the image of the author on their page. <a href="https://dev.openlibrary.org/authors/OL21718A/Bill_Bryson" target="_blank" rel="noreferrer">Author page</a></p><p><img src="https://user-images.githubusercontent.com/978325/59980045-17072f00-95a5-11e9-994b-e3c4c6941a7b.png" alt="Screen Shot 2019-06-22 at 14 25 17PMPDT"></p><p>Also used when clicking the image of a book cover on a <a href="https://dev.openlibrary.org/books/OL3684559M/A_short_history_of_nearly_everything" target="_blank" rel="noreferrer">book page</a>.</p><p><img src="https://user-images.githubusercontent.com/978325/59980043-140c3e80-95a5-11e9-939b-16e3ff992ab8.png" alt="Screen Shot 2019-06-23 at 10 51 30AMPDT"></p><p><img src="https://user-images.githubusercontent.com/978325/59980047-20909700-95a5-11e9-9708-f94f74338a85.png" alt="Screen Shot 2019-06-22 at 14 25 43PMPDT"></p><p>Also used when adding an item to a reading list via a Dropper component:</p><p><img src="https://user-images.githubusercontent.com/148752/45788898-04d11c80-bc32-11e8-9ca5-864bb08704f6.png" alt="screen shot 2018-09-19 at 5 32 12 pm"></p><p>(Uses rules #colorbox, #cboxOverlay, #cboxWrapper)</p><h3 id="datatables" tabindex="-1">dataTables <a class="header-anchor" href="#datatables" aria-label="Permalink to &quot;dataTables&quot;">​</a></h3><p>(please help document me!)</p><h3 id="diff" tabindex="-1">Diff <a class="header-anchor" href="#diff" aria-label="Permalink to &quot;Diff&quot;">​</a></h3><p>Renders <a href="https://openlibrary.org/books/OL7500626M/The_Time_Machine?b=9&amp;a=1&amp;_compare=Compare&amp;m=diff" target="_blank" rel="noreferrer">a diff</a></p><p><img src="https://user-images.githubusercontent.com/148752/45588767-023b9380-b8cf-11e8-99df-2e0142fd1ef7.png" alt="screen shot 2018-09-15 at 10 05 48 am"></p><h3 id="edit-toolbar" tabindex="-1">Edit-Toolbar <a class="header-anchor" href="#edit-toolbar" aria-label="Permalink to &quot;Edit-Toolbar&quot;">​</a></h3><p>Any wiki page that can be edited will have an edit toolbar</p><p><img src="https://user-images.githubusercontent.com/148752/46819962-e5617700-cd39-11e8-8745-513c075e6b96.png" alt="screen shot 2018-10-11 at 9 41 46 am"></p><h3 id="editionstable" tabindex="-1">EditionsTable <a class="header-anchor" href="#editionstable" aria-label="Permalink to &quot;EditionsTable&quot;">​</a></h3><p><img src="https://user-images.githubusercontent.com/148752/45579776-6c0c5c80-b83f-11e8-968e-ab6e9681caec.png" alt="EditionsTable"></p><h4 id="lists-variant" tabindex="-1">.lists variant <a class="header-anchor" href="#lists-variant" aria-label="Permalink to &quot;.lists variant&quot;">​</a></h4><p>When inside a .lists element this renders differently. (please help document me!)</p><h3 id="headedlinklist" tabindex="-1">HeadedLinkList <a class="header-anchor" href="#headedlinklist" aria-label="Permalink to &quot;HeadedLinkList&quot;">​</a></h3><p>A list of links with a heading as seen on <a href="https://openlibrary.org/subjects" target="_blank" rel="noreferrer">https://openlibrary.org/subjects</a></p><p><img src="https://user-images.githubusercontent.com/148752/46233807-fb7a3b00-c328-11e8-85b6-64b604ecc708.png" alt="screen shot 2018-09-28 at 2 14 56 pm"></p><p>We currently make use of .contentQuarter elements to arrange these side by side but it would be useful to have them modeled as their own component and deal with layout separately.</p><p>See also: <a href="#linkbox">LinkBox</a></p><h3 id="manage-covers" tabindex="-1">Manage-Covers <a class="header-anchor" href="#manage-covers" aria-label="Permalink to &quot;Manage-Covers&quot;">​</a></h3><p><img src="https://user-images.githubusercontent.com/148752/47894990-245b8780-de23-11e8-8364-ed1447477b71.png" alt="screen shot 2018-11-01 at 10 11 41 pm"></p><p>Shows when logged in and with JS enabled when you hover over a cover.</p><h3 id="page-history" tabindex="-1">Page-History <a class="header-anchor" href="#page-history" aria-label="Permalink to &quot;Page-History&quot;">​</a></h3><p><img src="https://user-images.githubusercontent.com/148752/45588626-732d7c00-b8cc-11e8-911d-358d86ce04f3.png" alt="screen shot 2018-09-15 at 9 47 20 am"></p><p>shows at the bottom of any wiki page, showing the revision history of that page.</p><p>(<a href="https://openlibrary.org/works/OL69395W/Historie_of_the_raigne_of_King_Henry_the_Seventh" target="_blank" rel="noreferrer">https://openlibrary.org/works/OL69395W/Historie_of_the_raigne_of_King_Henry_the_Seventh</a>).</p><h4 id="revisionhistorytable" tabindex="-1">RevisionHistoryTable <a class="header-anchor" href="#revisionhistorytable" aria-label="Permalink to &quot;RevisionHistoryTable&quot;">​</a></h4><p>Confusingly, a similar table renders on <a href="https://openlibrary.org/books/OL7500626M/The_Time_Machine?m=history" target="_blank" rel="noreferrer">the revision history page</a></p><p><img src="https://user-images.githubusercontent.com/148752/45588739-82152e00-b8ce-11e8-8509-451692cfd0e9.png" alt="RevisionHistoryTable"></p><h3 id="iabar" tabindex="-1">iaBar <a class="header-anchor" href="#iabar" aria-label="Permalink to &quot;iaBar&quot;">​</a></h3><p>Internet Archive Bar: A bar that appears at the top of all pages. Makes use of a <a href="#ButtonGhost">ButtonGhost</a>.</p><p><img src="https://user-images.githubusercontent.com/148752/45986591-5e19c100-c021-11e8-9993-49d8a71b2621.png" alt="screen shot 2018-09-24 at 5 43 24 pm"></p><h3 id="merge-form" tabindex="-1">Merge Form <a class="header-anchor" href="#merge-form" aria-label="Permalink to &quot;Merge Form&quot;">​</a></h3><p>Url: <a href="http://localhost:8080/authors/merge?key=OL6848355A&amp;key=OL18319A&amp;key=OL24522A" target="_blank" rel="noreferrer">http://localhost:8080/authors/merge?key=OL6848355A&amp;key=OL18319A&amp;key=OL24522A</a> Requires admin access</p><p><img src="https://user-images.githubusercontent.com/148752/53303008-489c0380-381a-11e9-87af-fb5e3994b9b0.png" alt="screen shot 2019-02-24 at 9 54 06 am"></p><h3 id="mybooks" tabindex="-1">MyBooks <a class="header-anchor" href="#mybooks" aria-label="Permalink to &quot;MyBooks&quot;">​</a></h3><p>Combines <a href="#MyBooksList">MyBooksList</a> and <a href="#MyBooksMenu">MyBooksMenu</a> In use on <a href="https://openlibrary.org/account/books/want-to-read" target="_blank" rel="noreferrer">https://openlibrary.org/account/books/want-to-read</a></p><h3 id="mybookslist" tabindex="-1">MyBooksList <a class="header-anchor" href="#mybookslist" aria-label="Permalink to &quot;MyBooksList&quot;">​</a></h3><p><img src="https://user-images.githubusercontent.com/148752/45579534-3cf4eb80-b83d-11e8-9891-167aeca012c7.png" alt="MyBooksList"></p><p>uses <a href="#searchresultitem">SearchResultItem</a></p><h3 id="mybooksmenu" tabindex="-1">MyBooksMenu <a class="header-anchor" href="#mybooksmenu" aria-label="Permalink to &quot;MyBooksMenu&quot;">​</a></h3><p><img src="https://user-images.githubusercontent.com/148752/50458626-58ca5c00-0919-11e9-9128-9f6749df13a6.png" alt="screen shot 2018-12-26 at 2 19 50 pm"></p><p>In use on <a href="https://openlibrary.org/account/books/want-to-read" target="_blank" rel="noreferrer">https://openlibrary.org/account/books/want-to-read</a></p><h3 id="olform" tabindex="-1">OLform <a class="header-anchor" href="#olform" aria-label="Permalink to &quot;OLform&quot;">​</a></h3><p>Used to render forms in OpenLibrary (please help document me!) Some examples:</p><ul><li><p>Search at top of <a href="https://openlibrary.org/subjects/science" target="_blank" rel="noreferrer">subjects page</a></p></li><li><p>the <a href="https://openlibrary.org/works/OL69395W/Historie_of_the_raigne_of_King_Henry_the_Seventh/edit" target="_blank" rel="noreferrer">edit a work page</a></p></li></ul><p><img src="https://user-images.githubusercontent.com/148752/45588481-5132fa00-b8ca-11e8-8028-66a61c79c1db.png" alt="olform"></p><p><img src="https://user-images.githubusercontent.com/148752/45588637-9ce6a300-b8cc-11e8-88ce-bdf91f288d40.png" alt="edit olform"></p><h3 id="readinglog-stats" tabindex="-1">ReadingLog-stats <a class="header-anchor" href="#readinglog-stats" aria-label="Permalink to &quot;ReadingLog-stats&quot;">​</a></h3><p>Undocumented component.</p><p>Used in openlibrary/templates/stats/readinglog.html</p><h3 id="readerstats" tabindex="-1">ReaderStats <a class="header-anchor" href="#readerstats" aria-label="Permalink to &quot;ReaderStats&quot;">​</a></h3><p><img src="https://user-images.githubusercontent.com/148752/50047549-4b38ea80-006c-11e9-9536-147aecdf37eb.png" alt="screen shot 2018-12-15 at 1 20 01 pm"></p><p>Example url: <a href="https://openlibrary.org/books/OL16180205M/Harry_Potter_and_the_Sorcerer&#39;s_Stone" target="_blank" rel="noreferrer">https://openlibrary.org/books/OL16180205M/Harry_Potter_and_the_Sorcerer&#39;s_Stone</a></p><h3 id="linkbox" tabindex="-1">LinkBox <a class="header-anchor" href="#linkbox" aria-label="Permalink to &quot;LinkBox&quot;">​</a></h3><p>Similar to HeadedLinkList but used to show related links, which are listed inline with a smaller heading. This element does not use a ul element, but does function in a very similar way.</p><p>Seen on <a href="https://openlibrary.org/subjects/science" target="_blank" rel="noreferrer">https://openlibrary.org/subjects/science</a> and on book pages</p><p><img src="https://user-images.githubusercontent.com/148752/46234230-81e34c80-c32a-11e8-9da6-90bde50df8d6.png" alt="screen shot 2018-09-28 at 2 25 40 pm"></p><p><img src="https://user-images.githubusercontent.com/148752/46572617-fb3bfa00-c93d-11e8-9344-8426b0910f00.png" alt="screen shot 2018-10-06 at 7 59 56 am"></p><p>See also <a href="#HeadedLinkList">HeadedLinkList</a></p><h3 id="all-pages" tabindex="-1">All Pages <a class="header-anchor" href="#all-pages" aria-label="Permalink to &quot;All Pages&quot;">​</a></h3><h4 id="headerbar" tabindex="-1">HeaderBar <a class="header-anchor" href="#headerbar" aria-label="Permalink to &quot;HeaderBar&quot;">​</a></h4><p>The header bar appears at the top of every page.</p><p><img src="https://user-images.githubusercontent.com/148752/45579420-50538700-b83c-11e8-81c8-02fe4f4bbd09.png" alt="HeaderBar"></p><h3 id="flashmessage" tabindex="-1">FlashMessage <a class="header-anchor" href="#flashmessage" aria-label="Permalink to &quot;FlashMessage&quot;">​</a></h3><p>Can be displayed on <strong>any page</strong> via JS to report feedback to a user after some form has been posted.</p><p><img src="https://user-images.githubusercontent.com/148752/49979199-dac28a00-ff02-11e8-897a-bdca47ec8fe5.png" alt="screen shot 2018-12-13 at 6 13 32 pm"></p><h4 id="flashmessagebookadded" tabindex="-1">FlashMessageBookAdded <a class="header-anchor" href="#flashmessagebookadded" aria-label="Permalink to &quot;FlashMessageBookAdded&quot;">​</a></h4><p><img src="https://user-images.githubusercontent.com/148752/49979201-dc8c4d80-ff02-11e8-8d3b-8a8c3741f107.png" alt="screen shot 2018-12-13 at 6 13 07 pm"></p><h4 id="flashmessageerror" tabindex="-1">FlashMessageError <a class="header-anchor" href="#flashmessageerror" aria-label="Permalink to &quot;FlashMessageError&quot;">​</a></h4><p><img src="https://user-images.githubusercontent.com/148752/49979204-ddbd7a80-ff02-11e8-914b-ee9bc540d27d.png" alt="screen shot 2018-12-13 at 6 12 42 pm"></p><h4 id="footer" tabindex="-1">Footer <a class="header-anchor" href="#footer" aria-label="Permalink to &quot;Footer&quot;">​</a></h4><p>The footer appears at the top of every page.</p><p><img src="https://user-images.githubusercontent.com/978325/45580060-bc84b980-b841-11e8-98e1-8041c4d5be60.png" alt="Footer"></p><h3 id="ratingsform" tabindex="-1">RatingsForm <a class="header-anchor" href="#ratingsform" aria-label="Permalink to &quot;RatingsForm&quot;">​</a></h3><p><img src="https://user-images.githubusercontent.com/148752/46891462-d0aadf00-ce1e-11e8-93be-a4c0dafcf69c.png" alt="screen shot 2018-10-12 at 1 00 18 pm"></p><h3 id="searchresultcontainer" tabindex="-1">SearchResultContainer <a class="header-anchor" href="#searchresultcontainer" aria-label="Permalink to &quot;SearchResultContainer&quot;">​</a></h3><p><img src="https://user-images.githubusercontent.com/148752/48243418-2ed2cf80-e395-11e8-9c0b-660b17dd959b.png" alt="screen shot 2018-11-08 at 8 30 13 pm"></p><p><a href="https://openlibrary.org/search?q=as&amp;mode=ebooks&amp;m=edit&amp;m=edit&amp;has_fulltext=true" target="_blank" rel="noreferrer">example</a></p><p>Contains: <a href="#SearchResultItem">#SearchResultItem</a>, <a href="#widgetbox">#widgetbox</a> and <a href="#LinkBox">#LinkBox</a></p><h3 id="searchresultitem" tabindex="-1">SearchResultItem <a class="header-anchor" href="#searchresultitem" aria-label="Permalink to &quot;SearchResultItem&quot;">​</a></h3><p><img src="https://user-images.githubusercontent.com/148752/45588596-fd291500-b8cb-11e8-9d0a-1508380f00b1.png" alt="screen shot 2018-09-15 at 9 44 34 am"></p><p><a href="https://openlibrary.org/search?q=as&amp;mode=ebooks&amp;m=edit&amp;m=edit&amp;has_fulltext=true" target="_blank" rel="noreferrer">example</a></p><h3 id="searchresultitemcta" tabindex="-1">SearchResultItemCTA <a class="header-anchor" href="#searchresultitemcta" aria-label="Permalink to &quot;SearchResultItemCTA&quot;">​</a></h3><p><img src="https://user-images.githubusercontent.com/148752/50458854-2588cc80-091b-11e9-96d4-d22631be9423.png" alt="screen shot 2018-12-26 at 2 32 53 pm"></p><p>e.g. <a href="https://openlibrary.org/account/books/want-to-read" target="_blank" rel="noreferrer">https://openlibrary.org/account/books/want-to-read</a></p><h3 id="searchresultsinstantresult" tabindex="-1">SearchResultsInstantResult <a class="header-anchor" href="#searchresultsinstantresult" aria-label="Permalink to &quot;SearchResultsInstantResult&quot;">​</a></h3><p>Shows up when you search from the header</p><p><img src="https://user-images.githubusercontent.com/148752/45588607-25b10f00-b8cc-11e8-9745-4341af79bb94.png" alt="screen shot 2018-09-15 at 9 45 05 am"></p><h3 id="ui-tabs-tabspanel" tabindex="-1">UI-Tabs / TabsPanel <a class="header-anchor" href="#ui-tabs-tabspanel" aria-label="Permalink to &quot;UI-Tabs / TabsPanel&quot;">​</a></h3><p>A tab component. See <a href="https://openlibrary.org/authors/OL27173A/Avi/edit" target="_blank" rel="noreferrer">author page</a> for an example.</p><p><img src="https://user-images.githubusercontent.com/148752/48854732-73804280-ed67-11e8-8548-a11257fc1327.png" alt="screen shot 2018-11-21 at 8 28 22 am"></p><h4 id="statschart" tabindex="-1">StatsChart <a class="header-anchor" href="#statschart" aria-label="Permalink to &quot;StatsChart&quot;">​</a></h4><p>Can be found on the home page. Graph rendered via an HTML canvas.</p><p><img src="https://user-images.githubusercontent.com/148752/45588471-29439680-b8ca-11e8-83ae-00ea4f9aa360.png" alt="StatsChart"></p><h3 id="pagebanner" tabindex="-1">PageBanner <a class="header-anchor" href="#pagebanner" aria-label="Permalink to &quot;PageBanner&quot;">​</a></h3><p><img src="https://user-images.githubusercontent.com/148752/45588543-3745e700-b8cb-11e8-8619-6228788dc7a5.png" alt="1"><img src="https://user-images.githubusercontent.com/148752/45588544-3745e700-b8cb-11e8-8b83-c8e9026f31f9.png" alt="2"></p><h3 id="edition-book" tabindex="-1">Edition (book) <a class="header-anchor" href="#edition-book" aria-label="Permalink to &quot;Edition (book)&quot;">​</a></h3><p>A mega component which puts together various other components. Appears on <a href="https://openlibrary.org/books/OL1447641M/Women_of_words" target="_blank" rel="noreferrer">book page</a></p><p><img src="https://user-images.githubusercontent.com/148752/46891776-ea98f180-ce1f-11e8-9f80-b2e973bdece8.png" alt="screen shot 2018-10-12 at 1 07 49 pm"></p><h3 id="listentry" tabindex="-1">ListEntry <a class="header-anchor" href="#listentry" aria-label="Permalink to &quot;ListEntry&quot;">​</a></h3><p><img src="https://user-images.githubusercontent.com/148752/48983560-0a6d3780-f0a5-11e8-98cf-439aaecb1194.png" alt="screen shot 2018-11-25 at 11 26 59 am"></p><p>Seen on <a href="https://openlibrary.org/lists" target="_blank" rel="noreferrer">lists</a> page.</p><h3 id="listspagecta" tabindex="-1">ListsPageCta <a class="header-anchor" href="#listspagecta" aria-label="Permalink to &quot;ListsPageCta&quot;">​</a></h3><p><img src="https://user-images.githubusercontent.com/148752/48983066-1d7d0900-f09f-11e8-918c-70db70321f7e.png" alt="screen shot 2018-11-25 at 10 43 12 am"></p><p>Seen on <a href="https://openlibrary.org/lists" target="_blank" rel="noreferrer">lists</a> page.</p><h3 id="listslists" tabindex="-1">ListsLists <a class="header-anchor" href="#listslists" aria-label="Permalink to &quot;ListsLists&quot;">​</a></h3><p>On <a href="https://openlibrary.org/works/OL100238W/The_Titan" target="_blank" rel="noreferrer">works page</a> and books pages:</p><p><img src="https://user-images.githubusercontent.com/148752/45706914-52666000-bb32-11e8-8d7e-89aeaf43a5c5.png" alt="screen shot 2018-09-18 at 11 01 54 am"></p><p>[pictured: dropit tool]</p><h3 id="sharelinks" tabindex="-1">ShareLinks <a class="header-anchor" href="#sharelinks" aria-label="Permalink to &quot;ShareLinks&quot;">​</a></h3><p><img src="https://user-images.githubusercontent.com/148752/45788170-c8032680-bc2d-11e8-8821-09d5f614dc28.png" alt="screen shot 2018-09-19 at 5 01 42 pm"></p><p>Appears on <a href="https://openlibrary.org/books/OL23053293M/Ranma_1_2." target="_blank" rel="noreferrer">book page</a>. I don&#39;t believe it appears anywhere else (??)</p><h3 id="dropper" tabindex="-1">Dropper <a class="header-anchor" href="#dropper" aria-label="Permalink to &quot;Dropper&quot;">​</a></h3><p>The dropper is an enhanced substitution <code>select</code> element. At time of writing it does not work without JavaScript (see #1147).</p><p><img src="https://user-images.githubusercontent.com/148752/45788340-e3bafc80-bc2e-11e8-9ab7-cf1fdef06d19.png" alt="screen shot 2018-09-19 at 5 10 04 pm"></p><h4 id="dropper-list" tabindex="-1">Dropper-list <a class="header-anchor" href="#dropper-list" aria-label="Permalink to &quot;Dropper-list&quot;">​</a></h4><p><img src="https://user-images.githubusercontent.com/148752/49094756-d49e8f00-f21b-11e8-9322-1473de1ce6fb.png" alt="screen shot 2018-11-27 at 8 09 30 am"></p><p>A variant of the dropper exists for things that are not books. Can be seen on subjects and authors pages.</p><p>Dropper with dropdown</p><p>(See also <a href="#Readstatuses">ReadStatuses</a> component, shown in image)</p><p><img src="https://user-images.githubusercontent.com/148752/45788362-0fd67d80-bc2f-11e8-8981-833512692122.png" alt="screen shot 2018-09-19 at 5 11 16 pm"></p><p>with activated-check</p><p><img src="https://user-images.githubusercontent.com/148752/45788381-2f6da600-bc2f-11e8-9ff0-eef3ba1f96fa.png" alt="screen shot 2018-09-19 at 5 11 57 pm"></p><p>When referring to &quot;Drop click&quot; we are referring to this part of the element:</p><p><img src="https://user-images.githubusercontent.com/148752/45788524-f1bd4d00-bc2f-11e8-9045-96320b08964d.png" alt="screen shot 2018-09-19 at 5 16 48 pm"></p><h3 id="mode-options" tabindex="-1">Mode-options <a class="header-anchor" href="#mode-options" aria-label="Permalink to &quot;Mode-options&quot;">​</a></h3><p>Radio buttons to toggle between different 3 different options</p><p>Seen - <a href="https://openlibrary.org/search" target="_blank" rel="noreferrer">https://openlibrary.org/search</a> , <a href="https://openlibrary.org/search?q=harry+potter" target="_blank" rel="noreferrer">https://openlibrary.org/search?q=harry+potter</a></p><p><img src="https://user-images.githubusercontent.com/31198893/46106538-99211d80-c1f6-11e8-818a-0ffed5e76aa8.png" alt="mode-options"></p><h3 id="books-page" tabindex="-1">Books Page <a class="header-anchor" href="#books-page" aria-label="Permalink to &quot;Books Page&quot;">​</a></h3><h3 id="read-panel" tabindex="-1">Read Panel <a class="header-anchor" href="#read-panel" aria-label="Permalink to &quot;Read Panel&quot;">​</a></h3><p>Appears on books page.</p><p><img src="https://user-images.githubusercontent.com/148752/46840895-11045180-cd7a-11e8-9d29-4f2a0b857ced.png" alt="screen shot 2018-10-11 at 5 20 57 pm"></p><h3 id="definition-list" tabindex="-1">Definition List <a class="header-anchor" href="#definition-list" aria-label="Permalink to &quot;Definition List&quot;">​</a></h3><p>Definition markup can be used to generate a definition list See <a href="https://www.w3.org/MarkUp/html3/deflists.html" target="_blank" rel="noreferrer">https://www.w3.org/MarkUp/html3/deflists.html</a></p><p><img src="https://user-images.githubusercontent.com/148752/46841001-70626180-cd7a-11e8-886c-713ff38b6bfb.png" alt="screen shot 2018-10-11 at 5 23 36 pm"></p><h3 id="readstatuses" tabindex="-1">ReadStatuses <a class="header-anchor" href="#readstatuses" aria-label="Permalink to &quot;ReadStatuses&quot;">​</a></h3><p>Shown when you click the <a href="#dropper">Dropper</a>component.</p><p><img src="https://user-images.githubusercontent.com/148752/46841305-e0251c00-cd7b-11e8-85f7-1f71a7344585.png" alt="screen shot 2018-10-11 at 5 33 55 pm"></p><h3 id="widgetbox" tabindex="-1">WidgetBox <a class="header-anchor" href="#widgetbox" aria-label="Permalink to &quot;WidgetBox&quot;">​</a></h3><p>Widget boxes are used for layout. They consist of a header, a hint and a component (which might be a list or another component on this page)</p><p>The screenshot shows a WidgetBox with an unordered list and a WidgetBox containing a ListsLists. <img src="https://user-images.githubusercontent.com/148752/47246697-3dd8ea00-d3b4-11e8-8c87-920b35fcf05e.png" alt="screen shot 2018-10-19 at 3 32 17 pm"></p><h3 id="navedition" tabindex="-1">NavEdition <a class="header-anchor" href="#navedition" aria-label="Permalink to &quot;NavEdition&quot;">​</a></h3><p>Appears at the top of book pages. Will probably be merged in future with another component once identified.</p><p><img src="https://user-images.githubusercontent.com/148752/47399581-fcb34380-d6ed-11e8-9c2b-7babc86fac17.png" alt="screen shot 2018-10-23 at 6 03 09 pm"></p><h3 id="pagealert" tabindex="-1">PageAlert <a class="header-anchor" href="#pagealert" aria-label="Permalink to &quot;PageAlert&quot;">​</a></h3><p><img src="https://user-images.githubusercontent.com/148752/52514686-de078880-2bc8-11e9-9287-0758ae459889.png" alt="screen shot 2019-02-08 at 5 41 26 pm"></p><p>Visit <a href="http://openlibrary.org/books/add" target="_blank" rel="noreferrer">http://openlibrary.org/books/add</a> incognito. Styled using #noLogin Similar styles exist (with different iconography) for #preMerge, #postMerge, #errorMerge</p><p>See also <a href="#FlashMessage">FlashMessage</a></p><h3 id="wmdbuttonbar" tabindex="-1">WmdButtonBar <a class="header-anchor" href="#wmdbuttonbar" aria-label="Permalink to &quot;WmdButtonBar&quot;">​</a></h3><p><img src="https://user-images.githubusercontent.com/148752/48293867-e4edf600-e435-11e8-8d56-11b3e0164722.png" alt="screen shot 2018-11-09 at 3 40 53 pm"></p><p>Seen on <a href="http://localhost:8080/people/openlibrary7774?m=edit" target="_blank" rel="noreferrer">http://localhost:8080/people/openlibrary7774?m=edit</a></p><h3 id="wmdpromptdialog" tabindex="-1">WmdPromptDialog <a class="header-anchor" href="#wmdpromptdialog" aria-label="Permalink to &quot;WmdPromptDialog&quot;">​</a></h3><p><img src="https://user-images.githubusercontent.com/148752/48294976-d6570d00-e43c-11e8-9653-18575fd04aab.png" alt="screen shot 2018-11-09 at 4 30 43 pm"></p><p>When editing a profile page, and clicking the link button in the wmd button bar this overlay shows. JavaScript is required.</p><h3 id="pageheadingsearchbox" tabindex="-1">PageHeadingSearchBox <a class="header-anchor" href="#pageheadingsearchbox" aria-label="Permalink to &quot;PageHeadingSearchBox&quot;">​</a></h3><p>A form within the page that allows searching the site.</p><p><img src="https://user-images.githubusercontent.com/148752/48653227-90f48b80-e9b8-11e8-983d-4ad68fc44404.png" alt="screen shot 2018-11-16 at 3 58 36 pm"></p><p>Seen on <a href="http://openlibrary.org/subjects/romance" target="_blank" rel="noreferrer">http://openlibrary.org/subjects/romance</a></p><p>Must appear at the top of the page.</p><h4 id="searchinsideform" tabindex="-1">searchInsideForm <a class="header-anchor" href="#searchinsideform" aria-label="Permalink to &quot;searchInsideForm&quot;">​</a></h4><p>A PageHeadingSearchBox must contain a searchInsideForm</p><p><img src="https://user-images.githubusercontent.com/148752/52514918-d47f2000-2bca-11e9-9273-35fe92d9901b.png" alt="screen shot 2019-02-08 at 5 56 07 pm"></p><p>Other examples:</p><ul><li><a href="http://openlibrary.org/lists" target="_blank" rel="noreferrer">http://openlibrary.org/lists</a></li></ul><h3 id="ui-dialog" tabindex="-1">UI-Dialog <a class="header-anchor" href="#ui-dialog" aria-label="Permalink to &quot;UI-Dialog&quot;">​</a></h3><p>Deprecated, but in use when removing lists on books pages. See also <a href="#colorboxoverlay">colorbox</a></p><p><img src="https://user-images.githubusercontent.com/148752/51061094-db544c00-15a6-11e9-8bed-12b2aabbd679.png" alt="screen shot 2019-01-11 at 1 41 48 pm"></p><h3 id="throbber" tabindex="-1">Throbber <a class="header-anchor" href="#throbber" aria-label="Permalink to &quot;Throbber&quot;">​</a></h3><p>Used when loading the carousel for changing covers for a book. Possibly reusable for other things?</p><p><img src="https://user-images.githubusercontent.com/148752/70363262-97aca580-183c-11ea-8a66-9c2015bda78a.png" alt="Screenshot 2019-12-06 at 3 24 50 PM"></p><h3 id="subnav" tabindex="-1">SubNav <a class="header-anchor" href="#subnav" aria-label="Permalink to &quot;SubNav&quot;">​</a></h3><p>A list of navigation links (tabs) that appear under the title e.g. <a href="https://openlibrary.org/recentchanges" target="_blank" rel="noreferrer">Recent changes</a>. When one is selected it should be bolded.</p><img width="626" alt="Screen Shot 2020-03-28 at 10 50 05 AM" src="https://user-images.githubusercontent.com/148752/77829855-eaf37e00-70e1-11ea-94b0-f0773830b9b3.png"> (Note the title &quot;Recent Changes&quot; should not be considered part of the component. <img width="481" alt="Screen Shot 2020-03-28 at 10 51 16 AM" src="https://user-images.githubusercontent.com/148752/77829876-0f4f5a80-70e2-11ea-8dc3-734c423f8a39.png">`,287)]))}const u=a(s,[["render",n]]);export{b as __pageData,u as default};
